Various studies have shown that published research is often characterized by 
publication bias, which is why excluding the “grey literature” (unpublished studies and studies published outside widely available journals) generally leads to overestimation of effect sizes (Levine, Asada, & Carpenter, 2009; 
https://doi.org/10.1017/langcog.2019.5  Published online by Cambridge University Pressbrugman et al.48Polanin, Tanner-Smith, & Hennessy, 2016). To avoid overestimation of effect 
sizes, meta-analysis experts strongly recommend including studies from a wide range of academic outlets: journal articles, books, but also doctoral dissertations and conference papers (Borenstein, Hedges, Higgins, & Rothstein, 2011; 
Rothstein, Sutton, & Borenstein, 2005). We therefore included studies on

